hwMeta.bodyText:
Switch(wSt)\
    .Case(wSt_t.wrIdle,
        If(bus_aw_valid._eq(1),
            wSt_next(wSt_t.wrData)
        ).Else(
            wSt_next(wSt)
        ))\
    .Case(wSt_t.wrData,
        If(bus_w_valid._eq(1),
            wSt_next(wSt_t.wrResp)
        ).Else(
            wSt_next(wSt)
        ))\
    .Default(
        If(bus_b_ready._eq(1),
            wSt_next(wSt_t.wrIdle)
        ).Else(
            wSt_next(wSt)
        ))

If(clk._onRisingEdge(),
    If(rst_n._eq(0),
        wSt(wSt_t.wrIdle),
        rSt(rSt_t.rdIdle)
    ).Else(
        wSt(wSt_next),
        rSt(rSt_next)
    )
)

Switch(rSt)\
    .Case(rSt_t.rdIdle,
        If((bus_ar_valid & ~isBramAddr & ~w_hs)._eq(1),
            rSt_next(rSt_t.rdData)
        ).Elif((bus_ar_valid & isBramAddr & ~w_hs)._eq(1),
            rSt_next(rSt_t.bramRd)
        ).Else(
            rSt_next(rSt)
        ))\
    .Case(rSt_t.bramRd,
        If((~w_hs)._eq(1),
            rSt_next(rSt_t.rdData)
        ).Else(
            rSt_next(rSt)
        ))\
    .Default(
        If(bus_r_ready._eq(1),
            rSt_next(rSt_t.rdIdle)
        ).Else(
            rSt_next(rSt)
        ))

Switch(state_reg)\
    .Case(state_type.fullIdle,
        If(on_off_reg._eq(1),
            state_reg_next(state_type.writeAddr)
        ).Else(
            state_reg_next(state_reg)
        ))\
    .Case(state_type.writeAddr,
        If(axi_aw_ready._eq(1),
            If(lenRem_reg._eq(1),
                state_reg_next(state_type.writeDataLast)
            ).Else(
                state_reg_next(state_type.writeData)
            )
        ).Else(
            state_reg_next(state_reg)
        ))\
    .Case(state_type.writeData,
        If((state_reg._eq(state_type.writeData) | state_reg._eq(state_type.writeDataLast)) & dataIn_vld._eq(1) & axi_w_ready._eq(1) & actualLenRem_reg._eq(2),
            state_reg_next(state_type.writeDataLast)
        ).Else(
            state_reg_next(state_reg)
        ))\
    .Default(
        If((state_reg._eq(state_type.writeData) | state_reg._eq(state_type.writeDataLast)) & dataIn_vld._eq(1) & axi_w_ready._eq(1),
            If(lenRem_reg != 0,
                state_reg_next(state_type.writeAddr)
            ).Else(
                state_reg_next(state_type.fullIdle)
            )
        ).Else(
            state_reg_next(state_reg)
        ))

Switch(state_reg)\
    .Case(state_type.writeData,
        If((state_reg._eq(state_type.writeData) | state_reg._eq(state_type.writeDataLast)) & dataIn_vld._eq(1) & axi_w_ready._eq(1),
            actualLenRem_reg_next((actualLenRem_reg._reinterpret_cast(Bits(8, signed=False)) - 1)._reinterpret_cast(Bits(8)))
        ).Else(
            actualLenRem_reg_next(actualLenRem_reg)
        ))\
    .Case(state_type.writeDataLast,
        If((state_reg._eq(state_type.writeData) | state_reg._eq(state_type.writeDataLast)) & dataIn_vld._eq(1) & axi_w_ready._eq(1),
            actualLenRem_reg_next(0)
        ).Else(
            actualLenRem_reg_next(actualLenRem_reg)
        ))\
    .Default(
        If(lenRem_reg > 16,
            actualLenRem_reg_next(16)
        ).Else(
            actualLenRem_reg_next(Concat(Bits(1, force_vector=True).from_py(0), lenRem_reg))
        ))
